C<ErrorResponse>. The search can be done using multiple criterion. If the
C<searchCriteriaModeOr> is present, any result matching any one criteria is
included in the results. Otherwise, only results matching all the search
criterion are included in the results. If no search criteria is specified, all
results are returned. Specifying C<searchCriteriaModeOr> without any search
criteria results in an C<ErrorResponse>. In all cases, if a
C<responseSizeLimit> is specified and the number of matching results is more
than this limit, then an C<ErrorResponse> is returned. Fixed parameters are:-

