=head3 UserPhoneDirectoryGetListRequest

Request a table containing the phone directory for a user's group. If the
user's group is part of an enterprise, the directory includes all users in the
enterprise and all entries in the enterprise common phone list and the common
phone list of the specified group  (if C<includeCommonPhoneList> is set to
true). If the user's group is part of a service provider, the directory
includes all users in the group and all entries in the common phone list (if
C<includeCommonPhoneList> is set to true) of the specified group.

The response is either C<UserPhoneDirectoryGetListResponse> or
C<ErrorResponse>. If the C<searchCriteriaModeOr> is present, any result
matching any one criteria is included in the results. Otherwise, only results
matching all the search criterias are included in the results. If no search
criteria is specified, all results are returned. In all cases, if a
C<responseSizeLimit> is specified and the number of matching results is more
than this limit, then an C<ErrorResponse> is returned. Specifying
C<searchCriteriaModeOr> without any search criteria results in an
C<ErrorResponse>. Fixed parameters are:-

=over 4

=item userId

=item includeCommonPhoneList

=back

Additionally there are generic tagged parameters.

=head3 UserPhoneDirectoryGetPagedListRequest

Request a table containing the phone directory for a user. Setting
C<isEnterpriseRequested> to true will return enterprise directory members in
the response if the user is in an enterprise. Otherwise, just the group
directory members for a user are returned in the response.

The response is either C<UserPhoneDirectoryGetPagedListResponse> or
C<ErrorResponse>. The search can be done using multiple criterias. If the
C<searchCriteriaModeOr> is present, any result matching any one criteria is
included in the results. Otherwise, only results matching all the search
criterias are included in the results. If no search criteria is specified, all
results are returned. In all cases, if a C<responseSizeLimit> is specified and
the number of matching results is more than this limit, then an
C<ErrorResponse> is returned. Specifying C<searchCriteriaModeOr> without any
search criteria results in an C<ErrorResponse>. Fixed parameters are:-

=over 4

=item userId

=item isEnterpriseInfoRequested

=item responsePagingControl

=back

Additionally there are generic tagged parameters.

