=head3 UserCallCenterAgentSignOutRequest

This request signs-out a call center agent. Administrator, supervisor and agent
itself can sign-out an agent. An empty OCI table in OCI-P response indicates
success and the agent has been signed out. This sign-out command will fail if
the agent is the last signed-in agent of any standard or premium call center to
which she is currently joined. If the sign-out fails, the OCI-P response will
contain a list of Call Centers for which the agent is the last signed-in agent.
If this special logic is not needed, C<UserCallCenterModifyRequest> can still
be used to change the agents ACD state without checking if the agent is the
last signed-in agent.

The response is either a C<UserCallCenterAgentSignOutResponse> or
C<ErrorResponse>. Fixed parameters are:-

=over 4

=item agentUserId

=back

Additionally there are generic tagged parameters.

