to restrict the number of rows returned using C<responsePagingControl>.If
C<responsePagingControl> is not specified, the value of Enhanced Call Logs
system parameter C<maxNonPagedResponseSize> will control the maximum number of
call logs can be returned.

The response is either a C<GroupEnhancedCallLogsGetListResponse> or an
C<ErrorResponse>. Fixed parameters are:-

