The response is either a C<SuccessResponse> or an C<ErrorResponse>.
Additionally there are generic tagged parameters.

=head3 UserEnhancedCallLogsGetListRequest17sp4

Request user's call logs. If the C<callLogType> is not specified, all types of
calls logs (placed, received, missed) are returned. The filters
"C<dateTimeRange>", "C<numberFilter>", "C<redirectedNumberFilter>",
C<accountAuthorizationCodeFilter>" and ""C<subscriberType>" are ignored if call
logs are stored in CDS. When "C<ReceivedOrMissed>" is specified as
"C<callLogType>" and call logs are stored in CDS, all call logs including
placed will be returned. It is possible to restrict the number of rows returned
using C<responsePagingControl>. If C<responsePagingControl> is not specified,
the value of Enhanced Call Logs system parameter C<maxNonPagedResponseSize>
will control the maximum number of call logs can be returned.

The response is either a C<UserEnhancedCallLogsGetListResponse17sp4> or an
